import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';

import Create from '../pages/festivals/Create';

//Loads only the Grid code here but in the example below loads all the code from package but only imports grid
//import { Grid } from '@mui/system/Unstable_Grid';
import Grid from '@mui/system/Unstable_Grid/Grid';
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';

const Footer = (props) => {

    const navigate = useNavigate();

    const [anchorEl, setAnchorEl] = useState(null);
    const open = Boolean(anchorEl);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <>

        <div class="footer">
            <div class="heads">
                <h3 class="">Features</h3>
                <h3 class="">Enterprise</h3>
                <h3 class="">Support</h3>
                <h3 class="">ICO</h3>
            </div>

            <div class="icons">
                <img startIcon={<EditIcon />}></img>
            </div>

            <h4 class="copyright">All rights reserved</h4>
        </div>

        </>
    );
};

export default Footer;
